void initPlayerPara(OD* od,int ste,int dir){
	createPlayer(od,getPlayerMoveNumber(od,ste),dir);
	od->state.existFlag=TRUE;
	od->state.deathFlag=FALSE;
	od->state.eventFlag=FALSE;
	od->state.maxHP=
	od->state.HP=200;
	od->state.maxStamina=
	od->state.stamina=100;
	od->state.maxCharge=100;
	od->state.charge=0;
	od->state.wallHeadFlag=
	od->state.wallFootFlag=
	od->state.wallKickFlag=FALSE;
	od->state.fallTime=0;
	od->state.fallFlag=FALSE;
	od->state.maxJumpCount=2;
	od->state.jumpCount=0;
	od->state.v0=0;
	od->state.vA=0;
	od->state.vX=0;
	od->state.i0=-4.5;
	od->state.iA=-4.5;
	od->state.iX=4.0;
	od->state.motionCount=0;
}
void createPlayer(OD* od,int num,int dir){
	int y,x;
	if(od->accept.number!=num||od->accept.direction!=dir){
		for(y=0;y<OBJECT_LINES;y++){
			for(x=0;x<OBJECT_COLS;x++){
				if(dir>0)
					od->state.look[y][x]=playerInfo[num][y][x];
				else if(dir<0)
					od->state.look[y][x]=playerInfo[num][y][OBJECT_COLS-x-1];
			}
		}
		od->now.number=num;
		od->now.direction=dir;
		od->now.existStartY=initInfoP[(dir>0)?0:1][num].existStartY;
		od->now.existStartX=initInfoP[(dir>0)?0:1][num].existStartX;
		od->now.existEndY=initInfoP[(dir>0)?0:1][num].existEndY;
		od->now.existEndX=initInfoP[(dir>0)?0:1][num].existEndX;
		od->now.crashStartY=initInfoP[(dir>0)?0:1][num].crashStartY;
		od->now.crashStartX=initInfoP[(dir>0)?0:1][num].crashStartX;
		od->now.crashEndY=initInfoP[(dir>0)?0:1][num].crashEndY;
		od->now.crashEndX=initInfoP[(dir>0)?0:1][num].crashEndX;
	}
}
int getPlayerMoveNumber(OD* od,int ste){
	switch(ste){
		case NO_ACTION:
			return 0;
		case WALK:
 			return 1;
 		case JUMP_UP:
 			return 4;
 		case JUMP_DOWN:
			return 5;
		case N_ATTACK1:
			return 6;
		case N_ATTACK2:
			return 9;
		case S_ATTACK:
			return 12;
		default:
			return 0;
	}
}
void motionPlayer(OD* mine,SD* sd,CD* pd,CD* ed,OD* id){
	switch(mine->now.motion){
		case NO_ACTION:
			if(mine->state.fallFlag==FALSE){
				if((mine->state.stamina+=2)>mine->state.maxStamina)
					mine->state.stamina=mine->state.maxStamina;
				mine->state.vX=0;
				createPlayer(mine,getPlayerMoveNumber(mine,mine->now.motion),mine->now.direction);
			}
			else{
				if(mine->state.fallTime<getParabolaTopTime(mine->state.v0))
					createPlayer(mine,getPlayerMoveNumber(mine,JUMP_UP),mine->now.direction);
				else
					createPlayer(mine,getPlayerMoveNumber(mine,JUMP_DOWN),mine->now.direction);
				mine->now.motion=NO_ACTION;
			}
			mine->state.motionCount=0;
			break;
		case WALK:
			if(mine->state.fallFlag==FALSE){
				if(mine->state.motionCount%20>=0&&mine->state.motionCount%20<5)
					createPlayer(mine,getPlayerMoveNumber(mine,mine->now.motion)+1,mine->now.direction);
				else if(mine->state.motionCount%20>=5&&mine->state.motionCount%20<10)
					createPlayer(mine,getPlayerMoveNumber(mine,mine->now.motion)+2,mine->now.direction);
				else if(mine->state.motionCount%20>=10&&mine->state.motionCount%20<15)
					createPlayer(mine,getPlayerMoveNumber(mine,mine->now.motion)+1,mine->now.direction);
				else if(mine->state.motionCount%20>=15)
					createPlayer(mine,getPlayerMoveNumber(mine,mine->now.motion),mine->now.direction);
			}
			else{
				if(mine->state.fallTime<getParabolaTopTime(mine->state.v0))
					createPlayer(mine,getPlayerMoveNumber(mine,JUMP_UP),mine->now.direction);
				else
					createPlayer(mine,getPlayerMoveNumber(mine,JUMP_DOWN),mine->now.direction);
			}
			if(mine->state.fallFlag==FALSE){
				if(mine->now.direction==RIGHT){
					mine->now.x+=mine->state.iX;
					if((mine->state.vX+=(int)(mine->state.iX/4))>(int)(mine->state.iX/4)*3)
					mine->state.vX=(int)(mine->state.iX/4)*3;
				}
				else{
					mine->now.x-=mine->state.iX;
					if((mine->state.vX-=(int)(mine->state.iX/4))<-(int)(mine->state.iX/4)*3)
						mine->state.vX=-(int)(mine->state.iX/4)*3;
				}
			}
			else{
				if(mine->state.vX*mine->now.direction<0){
					mine->state.vX*=-0.5;
					if(mine->state.vX>-1&&mine->state.vX<1)
						mine->state.vX=0;
				}
			}
			if(mine->state.fallFlag==FALSE)
				mine->state.motionCount++;
			mine->now.motion=NO_ACTION;
			break;
		case JUMP:
			if(mine->state.jumpCount<mine->state.maxJumpCount&&mine->state.stamina>=20){
				if(mine->state.wallKickFlag==TRUE){
					mine->state.vX*=-1;
					if(mine->state.vX>0)
						createPlayer(mine,mine->now.number,RIGHT);
					else if(mine->state.vX<0)
						createPlayer(mine,mine->now.number,LEFT);
				}
				mine->state.jumpCount++;
				mine->state.fallTime=0;
				mine->state.fallFlag=TRUE;
				mine->state.v0=mine->state.i0;
				mine->state.vA=mine->state.iA;
				mine->state.stamina-=20;
			}
			mine->now.motion=NO_ACTION;
			break;
		case N_ATTACK1:
		case N_ATTACK2:
			if(mine->state.motionCount==0){
				if(mine->state.stamina-10<0){
					mine->now.motion=NO_ACTION;
					break;
				}
				mine->state.stamina-=10;
			}
			if(mine->state.motionCount>=0&&mine->state.motionCount<5)
				createPlayer(mine,getPlayerMoveNumber(mine,mine->now.motion),mine->now.direction);
			else if(mine->state.motionCount>=5&&mine->state.motionCount<10)
				createPlayer(mine,getPlayerMoveNumber(mine,mine->now.motion)+1,mine->now.direction);
			else if(mine->state.motionCount>=10&&mine->state.motionCount<15)
				createPlayer(mine,getPlayerMoveNumber(mine,mine->now.motion)+2,mine->now.direction);
			else
				mine->now.motion=NO_ACTION;
			mine->state.motionCount++;
			break;
		case S_ATTACK:
			if(mine->state.motionCount==0){
				if(mine->state.stamina-50<0){
					mine->now.motion=NO_ACTION;
					break;
				}
				if(mine->state.charge-mine->state.maxCharge<0){
					mine->now.motion=NO_ACTION;
					break;
				}
				mine->state.stamina-=50;
				mine->state.charge-=mine->state.maxCharge;
			}
			if(mine->state.motionCount>=0&&mine->state.motionCount<5)
				createPlayer(mine,getPlayerMoveNumber(mine,mine->now.motion),mine->now.direction);
			else if(mine->state.motionCount>=5&&mine->state.motionCount<10)
				createPlayer(mine,getPlayerMoveNumber(mine,mine->now.motion)+1,mine->now.direction);
			else if(mine->state.motionCount>=10&&mine->state.motionCount<30)
				createPlayer(mine,getPlayerMoveNumber(mine,mine->now.motion)+2,mine->now.direction);
			else if(mine->state.motionCount>=30&&mine->state.motionCount<34)
				createPlayer(mine,getPlayerMoveNumber(mine,mine->now.motion)+3,mine->now.direction);
			else if(mine->state.motionCount>=34&&mine->state.motionCount<38){
				createPlayer(mine,getPlayerMoveNumber(mine,mine->now.motion)+4,mine->now.direction);
				sd->displayY-=4;
				bkgd(COLOR_PAIR(8));
			}
			else if(mine->state.motionCount>=38&&mine->state.motionCount<42){
				createPlayer(mine,getPlayerMoveNumber(mine,mine->now.motion)+5,mine->now.direction);
				sd->displayY+=6;
				bkgd(COLOR_PAIR(6));
			}
			else{
				mine->now.motion=NO_ACTION;
				sd->displayY-=2;
			}
			mine->state.motionCount++;
			break;
		default:
			break;
	}
}

